import React from 'react';

interface PolicyFormProps {
  isUpdate: boolean;
}

const PolicyForm: React.FC<PolicyFormProps> = ({ isUpdate }) => {
  return (
    <form className="bg-white p-6 rounded-lg shadow">
      <h2 className="text-xl font-bold mb-4">{isUpdate ? 'Update Policy' : 'Add Policy'}</h2>
      {/* Example form fields */}
      <div className="mb-4">
        <label className="block text-gray-700 mb-2">Policy Name</label>
        <input type="text" className="w-full border border-gray-300 rounded px-3 py-2" placeholder="Enter policy name" />
      </div>
      <div className="mb-4">
        <label className="block text-gray-700 mb-2">Policy Number</label>
        <input type="text" className="w-full border border-gray-300 rounded px-3 py-2" placeholder="Enter policy number" />
      </div>
      <button type="submit" className="bg-primary text-white px-4 py-2 rounded hover:bg-red-700 transition-colors">
        {isUpdate ? 'Update' : 'Add'} Policy
      </button>
    </form>
  );
};

export default PolicyForm;
